"i.walkWelcome8_2":"","i.walkWelcome8_3":"","i.walkWelcome9_1":"","i.walkWelcome9_2":"","i.walkWelcome9_3":"","i.walkWelcome10_1":"","i.walkWelcome10_2":"","i.walkWelcome10_3":"","i.walkWelcome11_1":"","i.walkWelcome11_2":"","i.walkWelcome11_3":"","i.walkWelcome12_1":"","i.walkWelcome12_2":"","i.walkWelcome12_3":"","i.walkWelcome13_1":"","i.walkWelcome13_2":"","i.walkWelcome13_3":"","i.walkSettings1_1":"Bienvenido a la pantalla de Ajustes","i.walkSettings1_2":"Aqu\u00ed puedes especificar informaci\u00f3n acerca de tu Excursi\u00f3n Virtual.",
"i.walkSettings1_3":"El t\u00edtulo y el avatar (una imagen que identifica tu excursi\u00f3n en la plataforma ViSH) son campos obligatorios, de modo que debes rellenarlos antes de publicar la excursi\u00f3n.","i.walkSettings1_4":"A la izquierda, puedes ver una previsualizaci\u00f3n de como tu excursi\u00f3n ser\u00e1 mostrada en la plataforma ViSH.","i.walkSettings2_1":"Escribe un t\u00edtulo (Obligatorio)","i.walkSettings2_2":"Escribe el t\u00edtulo de tu excursi\u00f3n en esta caja de texto. Este titulo es importante porque es el que se mostrar\u00e1 en la plataforma ViSH y el que ver\u00e1n el resto de usuarios.",
"i.walkSettings3_1":"A\u00f1ade un avatar para tu excursi\u00f3n (Obligatorio)","i.walkSettings3_2":"Pulsa sobre este bot\u00f3n para elegir una imagen que represente a tu excursi\u00f3n. Esta imagen ser\u00e1 el avatar de tu excursi\u00f3n y es importante porque ser\u00e1 mostrada en la plataforma ViSH, permitiendo a los usuarios identificar la excursi\u00f3n.","i.walkSettings4_1":"Escribe una descripci\u00f3n","i.walkSettings4_2":"Aqui puedes explicar en detalle sobre qu\u00e9 trata la excursi\u00f3n.",
"i.walkSettings4_3":"Esta descripci\u00f3n ser\u00e1 mostrada en la plataforma ViSH en la p\u00e1gina de esta excursi\u00f3n. Por lo tanto, todos los usuarios que accedan a esta excursi\u00f3n podr\u00e1n leerla.","i.walkSettings5_1":"Selecciona un tema para tu presentaci\u00f3n","i.walkSettings5_2":"Un tema define la apariencia visual de la presentaci\u00f3n. ViSH Editor ofrece diferentes temas entre los cuales puedes elegir.","i.walkSettings5_3":"Para seleccionar un tema, simplemente pulsa sobre el icono que quieras de esta galer\u00eda.",
"i.walkSettings5_4":"Recuerda que puedes cambiar el tema de la presentaci\u00f3n en cualquier momento accediendo a esta pantalla o pulsando sobre el bot\u00f3n 'Estilo' en la barra de herramientas.","i.walkSettings6_1":"A\u00f1ade etiquetas a tu excursi\u00f3n","i.walkSettings6_2":"Aqui puedes a\u00f1adir etiquetas (o palabras clave) a tu excursi\u00f3n.","i.walkSettings6_3":"Estas palabras clave son muy \u00fatiles para categorizar la excursi\u00f3n. Adem\u00e1s, tambi\u00e9n se emplean como t\u00e9rminos de b\u00fasqueda en la plataforma ViSH (asi como en otros repositorios), y por lo tanto a\u00f1adir palabras clave a una excursi\u00f3n facilita su b\u00fasqueda y acceso.",
"i.walkSettings6_4":"Ejemplos de etiquetas","i.walkSettings7_1":"Aspectos Pedag\u00f3gicos","i.walkSettings7_2":"Al pulsar sobre este bot\u00f3n aparecer\u00e1 la pantalla de Aspectos Pedag\u00f3gicos.","i.walkSettings7_3":"En esta pantalla podr\u00e1s especificar m\u00e1s informaci\u00f3n pedag\u00f3gica acerca de tu excursi\u00f3n.","i.walkSettings7_4":"Los detalles sobre la informaci\u00f3n que puede ser especificada se explican en la ayuda contextual de la pantalla de Aspectos Pedag\u00f3gicos.",
"i.walkSettings8_1":"Empezar a utilizar ViSH Editor","i.walkSettings8_2":"Una vez que hayas rellenado la informaci\u00f3n de tu excursi\u00f3n, por lo menos el t\u00edtulo y el avatar, puedes empezar a crear tu excursi\u00f3n con ViSH Editor pulsando sobre el bot\u00f3n 'Continuar'.","i.walkSettings8_3":"Si no deseas rellenar la informaci\u00f3n en este momento, tambi\u00e9n puedes empezar a usar ViSH Editor pulsando sobre el bot\u00f3n 'Rellenar despu\u00e9s', en este caso recuerda que deber\u00e1s volver a la pantalla de Ajustes y completar todos los campos obligatorios antes de publicar la excursi\u00f3n.",
"i.walkPedagogical1_1":"Bienvenido a la pantalla de Aspectos Pedag\u00f3gicos","i.walkPedagogical1_2_1":"En esta pantalla puedes especificar m\u00e1s informaci\u00f3n pedag\u00f3gica acerca de tu excursi\u00f3n. Estos metadatos est\u00e1n basados y son conformes al est\u00e1ndar LOM (Learning Object Metadata). La \u00faltima especificaci\u00f3n de este est\u00e1ndar, en la cual se explica de una manera detallada todos los campos de esta pantalla, se puede encontrar","i.walkPedagogical1_2_2":"aqu\u00ed",
"i.walkPedagogical1_3":"A continuaci\u00f3n se ofrece una breve explicaci\u00f3n de cada uno de los campos que se pueden especificar en esta pantalla.","i.walkPedagogical1_4":"El idioma de tu excursi\u00f3n.","i.walkPedagogical1_5":"El entorno principal dentro del cual est\u00e1 destinado a tener lugar el aprendizaje y uso de este objeto de aprendizaje (es decir, la excursi\u00f3n).","i.walkPedagogical1_6":"Edad del usuario t\u00edpico esperado.","i.walkPedagogical1_7":"Como de complicado es trabajar con o a trav\u00e9s de este objeto de aprendizaje.",
"i.walkPedagogical1_8":"Tiempo aproximado o t\u00edpico que se necesita para trabajar con este objeto de aprendizaje.","i.walkPedagogical1_9":"El tema (o temas) de esta excursi\u00f3n.","i.walkPedagogical1_10":"Comentarios acerca de como este objeto de aprendizaje puede o va a ser utilizado.","i.Language":"Idioma","i.Context":"Contexto","i.Age range":"Rango de edad","i.Difficulty":"Dificultad","i.Typicallearningtime":"Tiempo de aprendizaje t\u00edpico","i.Subject":"Tema","i.EducationalObjectives":"Objetivos educativos",
